// Menu.js

import React, { useState } from 'react';
import './assets/navbar.css';
import { NavLink } from 'react-router-dom';

const Menu = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const handleMenuToggle = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <nav className={`navbar ${menuOpen ? 'open' : ''}`}>
      <div className='limites'>
        <button className="menu-toggle" onClick={handleMenuToggle}>
          â˜°
        </button>
        <NavLink to="/home" activeClassName="active-link" className="nav-link">
          <img src="https://cdn-icons-png.flaticon.com/512/8280/8280362.png" alt="Usuario" />
          <p>Inicio</p>
          <div className="line"></div>
        </NavLink>
      </div>

      <div className={`menu-items ${menuOpen ? 'open' : ''}`}>
        <NavLink to="/ConfigurarEvento" activeClassName="active-link" className="nav-link">
          <img src="https://cdn-icons-png.flaticon.com/512/10746/10746540.png" alt="Usuario" />
          <div>
            <p>Crear Evento</p>
            <div className="line"></div>
          </div>
        </NavLink>

        <NavLink to="/CrearTipoEvento" activeClassName="active-link" className="nav-link">
          <img src="https://cdn-icons-png.flaticon.com/512/9790/9790435.png" alt="Usuario" />
          <div>
            <p>Crear Tipo Evento</p>
            <div className="line"></div>
          </div>
        </NavLink>
      </div>
    </nav>
  );
};

export default Menu;
